import React from 'react';
import { BrowserRouter as Router,Routes,Route } from 'react-router-dom';
import './App.scss';
import Home from "./Components/Home";
import Header from './Components/Header';
function App() {
  return (
    <Router>
      <Header />

      <Routes>
        <Route path='/' element={<Home/>} />
      </Routes>
    </Router>
  );
}

export default App;
